import Navbar from "./Navbar";
import NewsFeedItem from "./NewsFeedItem";
import styles from "./Layout.module.css";
import FavoriteItem from "./FavoriteItem";

const newsFeedItemList = [
  { src: "./tiger.jpg", title: "Tiger", id: "1" },
  { src: "./turtle.jpg", title: "Turtle", id: "2" },
  { src: "./sambar-deer.jpg", title: "Samber Deer", id: "3" },
  { src: "./squirrel.jpg", title: "Squrrel", id: "4" },
  { src: "./pupy.jpg", title: "Pupy", id: "5" },
];
export const siteTitle = "Demo App";

const Layout = ({ children, home }) => (
  <div>
    <Navbar />
    <div className={styles.topClearance}>
      {home
        ? newsFeedItemList.map((item, key) => {
            return <NewsFeedItem key={key} detail={item} />;
          })
        : ""}
    </div>
    {children}
  </div>
);

export default Layout;
